('00fc8796-b142-4a64-8709-10187370b8ff', 'CĂN HỘ FULL NỘI THẤT - CỬA SỔ THOÁNG MÁT GẦN ĐH KINH TẾ, HUFLIT, NTĐ PHÚ THỌ QUẬN 10', '0', 'TRUM2', 'Địa chỉ: 606 Đường số 3/2, Phường 14, Quận 10, Hồ Chí Minh', '5987d935-a29a-43dc-a2ee-93dcfc4e886d', 'CTCH', '[\"́\",\"CĂN HỘ FULL NỘI THẤT - CỬA SỔ THOÁNG MÁT GẦN ĐH KINH TẾ, HUFLIT, NTĐ PHÚ THỌ QUẬN 10\",\"Địa chỉ: 606 Ba Tháng Hai, Phường 14, Quận 10( tiện di chuyển sang Phú Nhuận, Quận 1, Quận 3, Quận 10)\",\"̛ ̂̉ ̉ ̀ ̀\",\"Hệ thống PCCC, Bảo trì, sửa chữa hư hỏng phát sinh trong 24h\",\"Không chung chủ, giờ giấc thoải mái, hệ thống Camera từ bãi xe đến hành lang.\",\"cửa sổ thoáng,mới 100%\",\"Ra vào vân tay, khu vực an ninh tốt,camera 24/24\",\"Có thang máy + hầm để xe rộng rãi, Máy giặt chung\",\"Liên hệ ngay để được xem phòng nhanh!\"]', '2706278d-060b-4534-8be1-243fe7d529cd', '83f2fd52-7a72-4375-bb0f-4d147a5e11af', '8ce9af24-d95c-4822-b1f0-947c206421a9', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('024a82b3-9a75-424f-9ead-86dd5f1fae33', 'Phòng trọ SV 30m2 full nội thất, sạch sẽ đường Bạch Đằng, chỉ 5tr5', '0', 'TNIH3', 'Địa chỉ: Hẻm 685 Đường Xô Viết Nghệ Tĩnh, Phường 26, Quận Bình Thạnh, Hồ Chí Minh', 'cde990d5-07b7-41f6-9a94-73ff4bf20eef', 'CTCH', '[\"Được thiết kế tông màu trắng kem, phòng nằm trong khu chung cư mini mới được xây dựng nên tổng thể rất sạch sẽ, trước kia ít người thuê.Đầy đủ nội thất, có thể dọn vào ở được ngay.\",\"- Tiện nghi đầy đủ, vào ở ngay (thang máy, ti vi lớn, tủ lạnh, điều hòa, kệ để sách v.v.)\",\"- Gần trung tâm (đi sang Quận 1, Quận 3 mất 10-15p)\",\"- Gần các trường đại học tại Bình Thạnh Hutech, Hồng Bàng, UEF, Ngoại Thương, v.v.\",\"- Đầy đủ chợ, siêu thị, cửa hàng tiện lợi, trung tâm thương mại.\",\"- Giờ giấc tự do, chìa khóa riêng\",\"Liên hệ mình để xem nhà nhé.\"]', 'eaacd054-8608-44fa-83f7-504ca5541fc5', '1cc62a7d-fd02-42b5-86a3-c3c9c4b4daa0', '48f13b83-ecf7-42df-9a98-4f6c7aab89dc', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('06f333c0-2554-4558-9df7-eee4ad1d0116', 'Cho thuê mặt bằng 40m2 MẶT TIỀN Lạc Long Quân', '0', 'LSXW1', 'Địa chỉ: 373 Đường Lạc Long Quân, Phường 5, Quận 11, Hồ Chí Minh', '383c621e-7015-423d-8bf2-8e3e3c9a4442', 'CTMB', '[\"Diện tích: 40m².\",\"- Đầy đủ tiện nghi hỗ trợ cho việc dạy học\",\"- Được trang bị TiVi, Máy lạnh, bàn ghế giáo viên - học sinh, bảng trắng,...\",\"- Phòng học mới, khang trang, cho thuê theo tháng/ theo giờ\",\"- Có 2 option cho bạn lựa chọn: phòng có nội thất giảng dạy cơ bản và phòng cho bạn tự decor\",\"- Tận dụng tối ưu hóa diện tích.\",\"- Vị trí nằm ngay mặt tiền đường Lạc Long Quân.\",\"- Free wifi, máy lạnh, nhà vệ sinh sạch sẽ\",\"- Khu vực yên tĩnh, An ninh tốt, có chỗ để xe trong và ngoài tòa nhà\",\"- Có thể mở lớp dạy được ngay\",\"Gía cả: 110.000/giờ hoặc thuê theo tháng\"]', 'f38b9016-502c-4627-9ea2-df2e38ac7eb1', '5dd18dfb-b6f7-4a3d-8171-56c64ee70a16', 'f415f7dd-1c0c-4cf3-ab53-a9715297d038', '2023-08-28 14:15:02', '2023-08-28 14:15:02'),
('0a580b86-03b7-4a3b-b6c6-e9fda9ad0646', 'PHÒNG TRỌ MỚI RẤT ĐẸP SỐ 373/1/2A ĐƯỜNG LÝ THƯỜNG KIỆT, QUẬN TÂN BÌNH - GẦN BÊN TRƯỜNG ĐẠI HỌC BÁCH KHOA', '5', '\'IEN9', 'Địa chỉ: 373/1/2A Phố Lý Thường Kiệt, Phường 9, Quận Tân Bình, Hồ Chí Minh', 'a20a653e-509b-40f6-89d2-5d4be4e07ffd', 'CTPT', '[\"PHÒNG TRỌ MỚI, ĐẸP SỐ 373/1/2a LÝ THƯỜNG KIỆT, GẦN ĐH BÁCH KHOA\",\"- Phòng nằm ngay trung tâm quận Tân Bình (xem hình thật). HẼM THÔNG, HẼM TO cách ĐƯỜNG LÝ THƯỜNG KIỆT 30m.\",\"- Nằm cách Trường Đại Học BÁCH KHOA 700m, cách chợ Ông Địa 100m, Nằm sau lưng trường THPT Nguyễn Thái Bình, cách chợ Tân Bình 800m\",\"- Phòng được ốp lát gạch sạch sẽ , tất cả các phòng đều có Máy lạnh, Quạt hút nhưng Cửa sổ vẫn bao la… nhiều phòng có BAN CÔNG rất thoáng mát.\",\"- Phòng có Gác lững đẹp nằm ngủ, có kệ Bếp nấu ăn, Toilet đầy đủ thiết bị vệ sinh, nước nóng năng lượng mặt trời\",\"- Thang máy chất lượng thuận tiện đi lại, Có Camera an ninh quan sát các tầng, khóa vân tay, Sân thượng phơi quần áo có mái che.\",\"- Internet cáp quang Wifi được lắp đặt từng phòng rất mạnh, cáp Tivi, Pccc tự động\",\"- Bỏ xe dưới tầng hầm bảo vệ trong coi, rất an ninh không chung chủ.\",\"- Bảo vệ trong coi 24/24 giúp Bạn có cảm giác an toàn, khóa vân tay giờ giấc tự do.\",\"(MỜI BẠN ĐẾN XEM PHÒNG, CÓ QUẢN LÝ TIẾP KHÁCH)\",\"- Địa chỉ 1: 373/1/2a Lý Thường Kiệt, phường 9, Tân Bình, Tp. Hồ Chí Minh.\",\"- Diện tích: 25 m2.\",\"- Giá Rẻ: Từ 3.7tr - 4,0 - 4.2tr/tháng.\",\"- Liên hệ: A Hiếu: 0918180057 hoặc 0931897679\",\" \",\" \"]', 'd3a38b0c-d55a-484f-9565-3a40a8a27b24', '1612104b-735f-43d5-8235-9e2477c64a13', 'afe7a90b-d236-40a3-bf8c-435a03a13774', '2023-08-28 14:16:05', '2023-08-28 14:16:05'),
('0bc2f77f-b41a-402d-8068-e47396d74ab0', 'Cho thuê nhà Hẻm 8m Cầu Xéo quận Tân Phú 4 x 15- 2T chỉ 10 triệu tl', '0', 'LIEO5', 'Địa chỉ: Đường Cầu Xéo, Phường Tân Quý, Quận Tân Phú, Hồ Chí Minh', 'cf7735fd-4490-4e61-a20d-eb5ec57e79c8', 'NCT', '[\"Cho thuê nhà cầu xéo thông Gò Dầu quận Tân Phú , nhà vi trí đẹp 8m cách 20m ra mặt tiền chỉ 10 triệu tl\",\"Dt 4 x 15m , trệt và lầu ,3 phòng ngủ, 2 tolet\",\"Tiện mở vpcty... Online\",\"Alo 0765.301.820\"]', 'a777bc1a-0db4-4850-bbfa-e9b481bce342', '6f1e22a8-662b-4687-9225-9d6aa62b0273', 'ca58c289-d151-40f1-8351-264a305c60df', '2023-08-28 14:17:02', '2023-08-28 14:17:02'),
('0bc5bed5-e802-4c71-8977-ba94d95615ff', 'Căn hộ Ban Công full nội thất ngay Nguyễn Văn Lượng, bảo vệ an ninh', '0', 'IBIJ5', 'Địa chỉ: 14 Đường Nguyễn Văn Lượng, Phường 6, Quận Gò Vấp, Hồ Chí Minh', '1253c8aa-71f9-43c2-8e7a-9d1068f5057a', 'CTCH', '[\"Vị trí đắc địa:\",\"Địa chỉ: 14 Nguyễn Văn Lượng, Phường 6, Gò Vấp.\",\"Gần các trường đại học: Văn Lang Cs3, Công Nghiệp, Mở,... tiện cho việc học tập.\",\"Nội thất sang trọng và hiện đại:\",\"Căn hộ được trang bị đầy đủ nội thất cao cấp: giường, nệm, tủ quần áo, máy lạnh, tủ lạnh - tiện nghi đáp ứng mọi nhu cầu.\",\"Khu vực an toàn và sầm uất:\",\"Bảo đảm an ninh tuyệt đối, nằm ngay trên con đường sầm uất với nhiều tiện ích, khu vực ăn uống phong phú.\",\"Tiện nghi và an toàn cao cấp:\",\"Toà nhà được trang bị thang máy hiện đại và hệ thống ra vào bằng vân tay - đảm bảo an toàn và tiện lợi cho cư dân.\",\"Giờ giấc tự do, đảm bảo sự thoải mái cho cuộc sống.\",\"An ninh và hỗ trợ 24/7:\",\"Đội ngũ bảo vệ chuyên nghiệp tại chỗ 24/7, kết hợp với hầm xe rộng rãi và an toàn.\",\"Hãy liên hệ ngay để được thăm quan căn hộ và trải nghiệm không gian sống lý tưởng này!\"]', 'dd2d29b6-6784-4842-bb16-2cea7a9d9c97', '32b6fb24-b8d6-4f02-9c38-cb050f012f20', '2f7ca95b-8137-44ac-a5c5-fed2a24f1ad6', '2023-08-27 08:27:01', '2023-08-27 08:27:01'),
('0d15bafc-fef4-412b-9cb0-55584190d046', 'Căn hộ mini cao cấp mới 100% khu biệt thự An Lộc Nguyễn Oanh, phù hợp tri thức văn phòng 4tr/th', '0', 'VAPC5', 'Địa chỉ: 537/34 Đường Nguyễn Oanh, Phường 15, Quận Gò Vấp, Hồ Chí Minh', '45d02b9d-a1cc-4d72-9ad2-df75b6881a15', 'CTCH', '[\"Cho thuê căn hộ mini cao cấp mới 100% trong khu biệt thự An Lộc, đường Nguyễn Oanh, Gò Vấp, an ninh, văn minh, không gian xanh, phù hợp người trí thức, văn phòng, vợ chồng trẻ, giá 4tr/tháng.\",\"Địa chỉ: 537/34 khu biệt thự An Lộc, Nguyễn Oanh, Gò Vấp (gần cầu An Lộc, thông qua Lê Đức Thọ).\",\"- Đây được coi là một trong những con đường huyết mạch của Gò Vấp, thuận tiện kết nối đến các con đường lớn nhộn nhịp Quang Trung, Phan Van Trị, Lê Đức Thọ.\",\"* Vị trí trung tâm thuận tiện đi lại:\",\"+ Chỉ mất 5 phút là đến sân bay Tân Sơn Nhất.\",\"+ 2 phút là tới các siêu thị sầm uất bậc nhất: Emart Phan Văn Trị, Lotte Nguyễn Văn Lượng, Coop Mart, BigC Quang Trung.\",\"+ 3 phút là tới chợ đêm Hạnh Thông Tây.\",\"+ Bán kính 1km là đầy đủ các trường học từ mầm non đến đại học, bệnh viện Gò Vấp, Hồng Đức, Vũ Anh.\",\"+ Nằm trong khu biệt thự an ninh, yên tĩnh, đường trước nhà 20m, có hàng cây xanh mát.\",\"+ Công viên công cộng tập thể dục đối diện nhà.\",\"+ 15 phút đến trung tâm Q1.\",\"* Nội thất cao cấp hiện đại sang trọng:\",\"+ 1 tủ gỗ chứa áo quần, cửa gỗ tự nhiên sang trọng.\",\"+ Dàn bếp cao cấp rộng rãi bằng gỗ tự nhiên.\",\"+ Có ban công, sân phơi đồ riêng từng căn hộ.\",\"+ Thiết bị vệ sinh cao cấp hiệu Inax, có máy nóng lạnh năng lượng mặt trời.\",\"+ Có sân để xe chung bao rộng.\",\"+ Có sân vườn cỏ tự nhiên, thoải mái ngồi thư giãn uống cafe, tổ chức tiệc BBQ.\",\"+ Camera 24/24, wifi tốc độ cao.\",\"* Mọi thứ đã sẵn sàng chỉ đến là ở ngay.\",\"Giá chỉ 3.5tr/tháng, điện 3 nghìn/kw, nước 15 nghìn/khối.\",\"Hãy gọi Ms Phương (SĐT: 0707.696.999) để hẹn giờ trước khi đến xem tránh tình trạng hết phòng làm mất thời gian của bạn.\",\"Xin chân thành cảm ơn!\"]', 'bcbf0c06-094c-4582-96b4-573cfa45ce09', '1110a90a-afe7-4829-bf34-db7aedf47941', '9337d321-2eb9-4c8e-88be-8680acc221d5', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('164947d2-1a89-43c6-bbb8-64507cf1def5', 'Mặt bằng tầng trệt phố tập đoàn lớn,văn phòng công ty ,địa điểm kinh doanh đa ngành nghề.', '0', 'AQSK5', 'Địa chỉ: 47 Phố số 56, Phường Bình Trưng Đông, Quận 2, Hồ Chí Minh', 'b3418571-23f5-4719-bef4-9cd0a3cf28ae', 'CTMB', '[\"Mặt bằng rộng tại tầng trệt ngay mặt đường lớn ,tập trung nhiều tập đoàn ,phố văn phòng công ty,kinh doanh ngành nghề nào cũng thuận tiện và dễ dàng thành công (ngang 6* dài 25) diện tích tha hồ rộng rãi.\",\"Xung quanh nhà còn có nhiều bãi đất trống ,đường rộng đậu xe vô tư .\"]', 'b6162704-be80-40aa-a786-a8b2b344f20b', 'cfa8f520-99e0-4fdc-aaa0-8393ac240d25', '7fdc91e0-0654-4b4d-ad96-6c3eed20bda6', '2023-08-28 14:15:02', '2023-08-28 14:15:02'),
('1ddeb0a0-b531-4682-9de1-d858351029c8', 'Cho Thuê Mặt Bằng Kinh Doanh Quận Phú Nhuận. 50 m2', '0', 'HAGI4', 'Địa chỉ: 21 Đường Bùi Văn Thêm, Phường 9, Quận Phú Nhuận, Hồ Chí Minh', 'dc83cd83-4bc2-44a2-a915-ac9f1c320ca1', 'CTMB', '[\"\\\"CHO THUÊ MẶT BẰNG _ KINH DOANH MỌI NGÀNH NGHỀ.\",\"Địa chỉ: Quận Phú Nhuận\",\"Diện tích: ~50m2 _ giá: 14tr/tháng\",\"Vị trí: nằm trên trục đường thương mại, thuận tiện kinh doanh đa ngành. Gần siêu thị Vinmart, siêu thị Mini top, ngân hàng, công viên,. Kế bên là trường ĐH Công Nghiệp.\",\"Văn phòng mới hoàn thiện, sạch sẽ, thoáng mát, chuyên khu văn phòng, dân trí cao.\",\"Có toilet riêng, lối đi riêng, ..\",\"Khu vực An ninh thanh lịch có bảo vệ 24/24.\",\"Xem phòng liên hệ: Chị Na (chủ nhà)\\\"\"]', 'b15ab684-a633-4667-92a2-f3f6b01bc151', '013eb171-8b38-4283-b104-4b3237f948f0', '1a0946bb-963e-47ad-b7c4-ca5b7ce85eeb', '2023-08-28 14:15:02', '2023-08-28 14:15:02'),
