('88b7569f-83a3-4a6d-a1f5-c1e0a8938ee2', 'Căn hộ mini cao cấp mới 100% khu biệt thự An Lộc Nguyễn Oanh, phù hợp tri thức văn phòng 4tr/th', '0', 'MAPI3', 'Địa chỉ: 537/34 Đường Nguyễn Oanh, Phường 15, Quận Gò Vấp, Hồ Chí Minh', '63c3526f-8521-4311-af44-fd05a05aa65e', 'CTCH', '[\"Cho thuê căn hộ mini cao cấp mới 100% trong khu biệt thự An Lộc, đường Nguyễn Oanh, Gò Vấp, an ninh, văn minh, không gian xanh, phù hợp người trí thức, văn phòng, vợ chồng trẻ, giá 4tr/tháng.\",\"Địa chỉ: 537/34 khu biệt thự An Lộc, Nguyễn Oanh, Gò Vấp (gần cầu An Lộc, thông qua Lê Đức Thọ).\",\"- Đây được coi là một trong những con đường huyết mạch của Gò Vấp, thuận tiện kết nối đến các con đường lớn nhộn nhịp Quang Trung, Phan Van Trị, Lê Đức Thọ.\",\"* Vị trí trung tâm thuận tiện đi lại:\",\"+ Chỉ mất 5 phút là đến sân bay Tân Sơn Nhất.\",\"+ 2 phút là tới các siêu thị sầm uất bậc nhất: Emart Phan Văn Trị, Lotte Nguyễn Văn Lượng, Coop Mart, BigC Quang Trung.\",\"+ 3 phút là tới chợ đêm Hạnh Thông Tây.\",\"+ Bán kính 1km là đầy đủ các trường học từ mầm non đến đại học, bệnh viện Gò Vấp, Hồng Đức, Vũ Anh.\",\"+ Nằm trong khu biệt thự an ninh, yên tĩnh, đường trước nhà 20m, có hàng cây xanh mát.\",\"+ Công viên công cộng tập thể dục đối diện nhà.\",\"+ 15 phút đến trung tâm Q1.\",\"* Nội thất cao cấp hiện đại sang trọng:\",\"+ 1 tủ gỗ chứa áo quần, cửa gỗ tự nhiên sang trọng.\",\"+ Dàn bếp cao cấp rộng rãi bằng gỗ tự nhiên.\",\"+ Có ban công, sân phơi đồ riêng từng căn hộ.\",\"+ Thiết bị vệ sinh cao cấp hiệu Inax, có máy nóng lạnh năng lượng mặt trời.\",\"+ Có sân để xe chung bao rộng.\",\"+ Có sân vườn cỏ tự nhiên, thoải mái ngồi thư giãn uống cafe, tổ chức tiệc BBQ.\",\"+ Camera 24/24, wifi tốc độ cao.\",\"* Mọi thứ đã sẵn sàng chỉ đến là ở ngay.\",\"Giá chỉ 3.5tr/tháng, điện 3 nghìn/kw, nước 15 nghìn/khối.\",\"Hãy gọi Ms Phương (SĐT: 0707.696.999) để hẹn giờ trước khi đến xem tránh tình trạng hết phòng làm mất thời gian của bạn.\",\"Xin chân thành cảm ơn!\"]', 'e6a26815-ebb2-413a-815e-659ae49b06d4', '64eb70d6-1178-4d9a-b4c2-6cc6e6b14668', '3c985cdd-7cba-4298-a2a6-a99b372cb396', '2023-08-27 08:27:01', '2023-08-27 08:27:01'),
('8a5b271e-38dd-479e-80d0-57868fab62c9', 'Cho thuê nhà mới đẹp Cách Mạng Tháng Tám P10 Q3', '0', 'YNXE6', 'Địa chỉ: Đường Cách Mạng Tháng Tám, phường 10, Quận 3, Hồ Chí Minh', '46d0f211-ee8c-4c27-8f33-211c1fdf3dbe', 'NCT', '[\"Cho thuê nhà mới đẹp Cách Mạng Tháng Tám P10 Q3\",\"Nhà rộng ngang 4m dài 16m\",\"Nhà 1 tret -1 lầu, 2wc, 2 phòng ngủ, 1 bếp, 1 phòng khách trệt suốt rộng, 1 phòng máy giặt\",\"Nội thất: 1 sofa, 3 máy lạnh, 1 tivi, 2 máy nóng lạnh\",\"Hẻm ba gác 2,5m\",\"Giá: 10.5 triệu ( cọc 2)\",\"LH: 0947.043.751 (zalo/ib/call)\",\"Gọi trước 30p trước khi qua nha\"]', '76daaa2e-ba2a-4330-be83-f9a8987fc797', 'c31db099-6cdf-4461-af79-c7158b8d1379', '33dab1c7-5163-4e72-a992-53ef3bba73c0', '2023-08-28 14:17:02', '2023-08-28 14:17:02'),
