('8cafdece-97b1-4126-8a0d-45ed8206f106', 'KHAI TRƯƠNG CĂN HỘ BAN CÔNG THOÁNG MÁT - THIẾT KẾ SIÊU XỊN NGAY GÒ VẤP', '0', 'KLHM1', 'Địa chỉ: 201 Đường Nguyễn Thái Sơn, Phường 7, Quận Gò Vấp, Hồ Chí Minh', 'c948f41d-9a8e-48ec-8502-25f381719989', 'CTCH', '[\"KHAI TRƯƠNG CĂN HỘ BAN CÔNG THOÁNG MÁT - THIẾT KẾ SIÊU XỊN NGAY GÒ VẤP\",\"Địa chỉ: 201 Nguyễn Thái Sơn, Gò Vấp.\",\"- Giap đường Phan Văn Trị, gần Siêu Thị Emart, giao với tuyến đường lớn Phạm Văn Đồng.\",\"- Chỉ mất 2 phút đại học Công Nghiệp.\",\"- Mất 5 phút tới Sân Bay Tân Sơn Nhất.\",\"- Phòng full nội thất như hình.\",\"- Không chung chủ, giờ giấc tự do\",\"Liên hệ ngay để được xem phòng nhanh!\"]', '5e922e93-19d8-45ca-9162-c0129380f70c', '9bd05c67-5a47-4343-89c6-da76dba36de1', '1da4608f-7026-43d9-bdf1-df178049c66b', '2023-08-27 08:27:01', '2023-08-27 08:27:01'),
('8dd3f445-128f-47d9-a452-b58798e69dfa', '[Bình Thạnh] Cho thuê căn hộ mini mới đủ tiện nghi đẹp gần chợ Bà Chiểu, giá 4,5 tr', '3', 'G\'SK2', 'Địa chỉ: 5 Đường Nơ Trang Long, Phường 7, Quận Bình Thạnh, Hồ Chí Minh', 'e12ab3c0-f03e-40d5-a19f-f9241f9d3df0', 'CTPT', '[\"Phòng mới đều thông thoáng, xe hơi đến tận nhà. hình chụp thật 100%\",\"*Đặc điểm: tiện nghi đầy đủ chỉ cần xách quần áo vào ở. Có kệ bếp riêng và được nấu ăn.\",\"Chỗ để xe rộng rãi, xe hơi có thể đậu trước nhà. Chỉ cần xách va li vào ở.\",\"GIờ giấc tự do, ra vào có chìa khóa riêng, khu vực chung vệ sinh sạch sẽ miễn phí.\",\"*Chỉ thu chi phí sử dụng điện, nước, wifi\",\"*Miễn phí: truyền hình cáp, bãi đậu xe có camera quan sát trong và ngoài, vệ sinh, an ninh, rác..\",\"*Vị trí:nằm trong khu vực dân sinh cao cấp, người dân ý thức, không trộm cướp. Ngoài sân và trong nhà đều lắp đặt hệ thống camera giám sát an ninh. Đầu đường và cuối đường là chốt công an khu vực thường xuyên đi tuần tra.\",\"Nhà ngay ngã tư Đinh Tiên Hoàng, Nơ Trang Long, Phan Đăng Lưu, gần chợ Bà Chiểu, bên hông bệnh viện Ung Bướu, khu vực sầm uất về đêm, nhiều nhà hàng, quán ca phê, siêu thị tiện lợi, coop mart, các dịch vụ làm đẹp......khu dân cư an ninh, cao cấp chỉ cần đi bộ là có thể mua mọi thứ cần thiết.\",\"Giao thông: thông với các con đường: hoàng Hoa Thám, Phan Đăng Lưu, Đinh Tiên Hoàng, Vạn Kiếp, Vũ Huy Tấn.....\",\"Hiện tại nhà mới bắt đầu cho thuê, còn nhiều phòng cho các bạn chọn lưa. Có ưu đãi cho các bạn thuê lâu dài. ƯU tiên người đi làm cần không gian yên tĩnh, riêng tư thoải mái để nghỉ ngơi.\",\"Liên hệ xem nhà từ 9h đến 19h\",\"Chúc mọi người ngày làm việc tốt lành!\"]', '0ebc28ee-0213-4653-8508-8446ef7d8e38', 'ddcb392f-325e-4ad9-878c-6ed132ce971f', 'aa36ba44-cc2b-45f1-9caa-f3bdb59a364a', '2023-08-28 14:16:05', '2023-08-28 14:16:05'),
('903deead-f997-474f-b873-cde4ea8b20f0', 'Căn hộ DV Đủ Nội Thất – 1PN, PK – Có Ban Công - 224/20 Lý Thường Kiệt, Phường14, Quận 10 (Đối diện nhà thi đấu Phú Thọ)', '0', 'RZDL5', 'Địa chỉ: 224/20 Lý Thường Kiệt, Phường 14, Quận 10, Hồ Chí Minh', '88965164-562f-48d4-9a39-351cfa544258', 'CTCH', '[\"Hệ thống phòng Hoàng Phương hân hạnh thông báo về việc cho thuê phòng và căn hộ dịch vụ đầy đủ nội thất trong toà nhà cao cấp, vừa hoàn thành mới 100%, có thang máy dành cho bạn là những khách đầu tiên đến ở \",\"Địa chỉ: 224/20 Lý Thường Kiệt, Phường 14, Quận 10, TP.Hồ Chí Minh.\",\"+ Diện Tích: 35m2 phòng Căn Hộ đủ Nội Thất sang trọng có Phòng Ngủ và Phòng Khách riêng biệt rộng rãi , có Ban Công thoáng mát với view đẹp.\",\"+ Các Phòng và Căn Hộ đều trang bị Tiện nghi đầy đủ:\",\"- Máy lạnh tiết kiệm điện, Tủ lạnh lớn 2 cánh, Giường, Nệm cao su, Tủ áo, Tủ bếp rất đẹp, bàn ăn hoặc bàn làm việc trong phòng khách …\",\"+ Nhà có Khoá Vân Tay, camera an ninh, giờ giấc tự do cho bạn cảm giác như ở chính nhà của mình.\",\"+ Trước cửa nhà là trạm xe bus tiện đi tất cả các Quận trong thành phố.\",\"+ Máy giặt miễn phí.\",\"+ Cửa sổ và ban công đem thiên nhiên vào phòng bạn.\",\"+ Thang máy cho bạn di chuyển nhẹ nhàng.\",\"+ Có đội sữa chữa, hổ trợ mọi vấn đề 24/24.\",\"+ Vị trí ngay trung tâm siêu thuận lợi: Nhà nằm đối diện nhà thi đấu, trường đua Phú Thọ, ngay cạnh các ngã tư Lý Thường Kiệt – Tô Hiến Thành – Đường 3/2 – Thành Thái – Nguyễn Tri Phương. Gần sát bên các Đại Học Bách Khoa, ĐH Y Dược, ĐH Hoa Sen, ĐH Huflit …. Gần Bệnh Viện Chợ Rẫy, BV 115, BV ĐH Y Dược … thuận tiện đi lại mọi nơi trong thành phố.\",\"+ Khu dân cư an ninh, yên tĩnh, rất thích hợp cho các bạn sinh viên, nhân viên văn phòng, gia đình hay người nước ngoài sinh sống và làm việc.\",\"+ Giá thuê bất ngờ: Chỉ với: 6 Triệu - 6.5 Triệu/Tháng cho Căn Hộ rộng với Phòng Ngủ và Phòng Khách riêng  bạn sẽ sở hữu ngay một căn phòng như mình mong muốn.\",\"- Sự hài lòng của quí khách là niềm vui của chúng tôi.\",\"- Vui lòng gọi ngay A. Hoàng qua số: 0937554570 (nhiệt tình và chu đáo) để hẹn gặp bạn tại chính căn phòng sang trọng, tuyệt vời này!\"]', 'a2764c98-ace8-4bf0-b842-5a9a3de8483a', 'edd7bfd7-8f71-4afb-b96a-19719a8eb2b3', 'd0d6e30f-15a0-4b2a-bacc-ef32a120e750', '2023-08-27 08:27:01', '2023-08-27 08:27:01'),
