('ee0a84e6-4ea4-4b1c-be4d-526c86d26f28', 'Quận 12 - Căn hộ Nhân Đức mới xây dựng - Nội thất sang trọng', '4', 'YDLB4', 'Địa chỉ: 338 Đường Nguyễn Văn Quá, Phường Đông Hưng Thuận, Quận 12, Hồ Chí Minh', 'ecb4899c-27e2-45b6-a468-8b685ac5fec3', 'CTCH', '[\"Cho thuê phòng, có máy lạnh, kệ bếp , an ninh 24/24, có bảo vệ, giờ giấc tự do.\",\"Địa chỉ: Quận 12 - Phường Đông Hưng Thuận - Số nhà 338 Nguyễn Văn Quá\",\"Vị trí:\",\"- Đường lớn nằm cắt 2 tuyến đường huyết mạch giữa Trường Trinh (Tân Bình, Tân Phú) và đường Quang Trung (Gò Vấp)\",\"- Tiện đi lại vì gần trạm xe buýt vào trung tâm qua các Quận Tân Bình, Bình Thạnh, Quận 12, Quận Thủ Đức 10 phút.\",\"- Gần trường đại học, bệnh viện, chợ, KFC, CGV\",\"- Khu dân trí cao, ngay trung tâm Gò Vấp nên gần các khu giải trí cho các bạn thõa sức vui chơi\",\"Tiện ích:\",\"- Diện tích: 20m2 ( rộng rãi ở được 3 4 người )\",\"- Có Máy lạnh mới 100%, kệ bếp bồn rửa.\",\"- Có thang máy tiện lợi.\",\"- Sân thượng rộng rãi phơi đồ\",\"- WC riêng từng phòng, thiết bị cao cấp, nước nóng lạnh.\",\"- Bảo vệ 24/24, camera được trang bị quanh nhà, đảm bảo cho tài sản của bạn được an toàn tuyệt đối.\",\"- Hầm để xe máy rộng rãi, an toàn.\",\"- Giờ giấc tự do, bạn bè, người thân đến chơi thoải mái.\",\"Các chi phí:\",\"- Điện 3.500kWh\",\"- Nước: 100k/người.\",\"- Wifi + rác + vệ sinh: 100k/người\",\"- Xe: 100k/xe\",\"Giá: 2,8 triệu - 4 triệu\",\"Đăc biệt có phòng dành cho các bạn sinh viên : 1,2 - 1,5 triêu/ tháng. (Có máy giặt chung)\",\"Liên hệ: 0987.385.968 - Anh Tâm\"]', 'b9afe7e0-5e71-434f-8245-912755718b9c', 'f3e62d6c-998d-43b2-8558-6fc893d0c018', '5162284a-0592-4087-a5d5-70161dff7391', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('f19e0703-afec-4bfc-8f83-6fe985afe8f1', 'Phòng trọ SV 30m2 full nội thất, sạch sẽ đường Bạch Đằng, chỉ 5tr5', '0', 'MWIP2', 'Địa chỉ: Hẻm 685 Đường Xô Viết Nghệ Tĩnh, Phường 26, Quận Bình Thạnh, Hồ Chí Minh', '4c9be52f-bef8-4305-b41e-37549ed6f1a7', 'CTCH', '[\"Được thiết kế tông màu trắng kem, phòng nằm trong khu chung cư mini mới được xây dựng nên tổng thể rất sạch sẽ, trước kia ít người thuê.Đầy đủ nội thất, có thể dọn vào ở được ngay.\",\"- Tiện nghi đầy đủ, vào ở ngay (thang máy, ti vi lớn, tủ lạnh, điều hòa, kệ để sách v.v.)\",\"- Gần trung tâm (đi sang Quận 1, Quận 3 mất 10-15p)\",\"- Gần các trường đại học tại Bình Thạnh Hutech, Hồng Bàng, UEF, Ngoại Thương, v.v.\",\"- Đầy đủ chợ, siêu thị, cửa hàng tiện lợi, trung tâm thương mại.\",\"- Giờ giấc tự do, chìa khóa riêng\",\"Liên hệ mình để xem nhà nhé.\"]', 'ad756939-bc27-4139-8de5-f5f94b0a3385', '2706fdda-3c3d-4fda-8b79-1ec9d0be2b83', 'faf5004c-2104-4500-bb7b-fcb7a2c79f4c', '2023-08-27 08:27:01', '2023-08-27 08:27:01'),
('f1b99944-3d0a-41c6-88c7-d7747a721055', 'Cho Thuê Phòng Studio Ban Công Cực Đẹp, Gần Đại học Văn Lang, dân cư Bình Lợi', '3', 'ESPS8', 'Địa chỉ: Đường Bình Lợi, Phường 13, Quận Bình Thạnh, Hồ Chí Minh', '59a49997-8b6b-4c41-a3af-ad6407ebf905', 'CTPT', '[\"Cho Thuê Phòng studio 40m2\",\"Trong khu dân cư Bình Lợi\",\"Gần trung Tâm. Trường hợp Văn Lang. Phòng Gym. Công viên... Vvv\",\"Điện : 3.5k/kw\",\"Nước : 100k/ng\",\"Dv: 150k/ph\",\"Liên hệ. 0938715868 huy\"]', '5f86f4e1-f1e2-4a49-84bc-45ed6e13d2a7', 'd0271319-b8bd-4242-ae04-def2b71a7d25', 'eb066b7f-abfd-4120-a3db-8231ea227d30', '2023-08-28 14:16:05', '2023-08-28 14:16:05');
INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesId`, `categoryCode`, `description`, `userId`, `overviewId`, `imagesId`, `createdAt`, `updatedAt`) VALUES
('f1d77627-60f3-4c18-825c-6a4b8da38a29', 'Cho thuê nhà nguyên căn HXH 449 Lê Quang Định, 3,8x20m, 1 lầu, 4 phòng, tiện ở hoặc Kinh Doanh', '0', 'FFMN3', 'Địa chỉ: 449 Đường Lê Quang Định, Phường 5, Quận Bình Thạnh, Hồ Chí Minh', '6a864211-85b0-424d-88fc-d437228a8098', 'NCT', '[\"- Cần cho thuê nhà nguyên căn hẻm xe hơi vào tận nhà, cách mặt tiền Lê Quang Định 20m.\",\"- Diện tích 3,8x20m, kết cấu 1 trệt + 1 lầu.\",\"- Diện tích sàn sử dụng 140m2.\",\"- Nhà gồm 1 PK, bếp, 2WC, 4 phòng, có sân đậu xe, có ban công thoáng mát.\",\"- Thích hợp thuê ở hoặc kinh doanh đều được, khu vực an ninh, dân trí cao, di chuyển trung tâm thuận tiện, xung quanh nhiều tiện ích...\",\"- Giá 14 triệu/tháng (thương lượng)\",\"- Liên hệ Nguyên 0985114432 xem nhà.\",\"- Xin MTG.\"]', 'a9ced761-940b-4f99-971f-c64885478018', '6d30ce14-b11f-49a5-b04a-37732b9896bc', '8a8511a0-b111-4d53-aa03-839c0c9992a8', '2023-08-28 14:17:02', '2023-08-28 14:17:02'),
('fa3954c7-92df-4b3c-bbc7-abb62f491ee0', 'Căn hộ DV Đủ Nội Thất – 1PN, PK – Có Ban Công - 224/20 Lý Thường Kiệt, Phường14, Quận 10 (Đối diện nhà thi đấu Phú Thọ)', '0', 'LZLG5', 'Địa chỉ: 224/20 Lý Thường Kiệt, Phường 14, Quận 10, Hồ Chí Minh', '3ba45923-78b3-4487-86bc-3b56da287ff0', 'CTCH', '[\"Hệ thống phòng Hoàng Phương hân hạnh thông báo về việc cho thuê phòng và căn hộ dịch vụ đầy đủ nội thất trong toà nhà cao cấp, vừa hoàn thành mới 100%, có thang máy dành cho bạn là những khách đầu tiên đến ở \",\"Địa chỉ: 224/20 Lý Thường Kiệt, Phường 14, Quận 10, TP.Hồ Chí Minh.\",\"+ Diện Tích: 35m2 phòng Căn Hộ đủ Nội Thất sang trọng có Phòng Ngủ và Phòng Khách riêng biệt rộng rãi , có Ban Công thoáng mát với view đẹp.\",\"+ Các Phòng và Căn Hộ đều trang bị Tiện nghi đầy đủ:\",\"- Máy lạnh tiết kiệm điện, Tủ lạnh lớn 2 cánh, Giường, Nệm cao su, Tủ áo, Tủ bếp rất đẹp, bàn ăn hoặc bàn làm việc trong phòng khách …\",\"+ Nhà có Khoá Vân Tay, camera an ninh, giờ giấc tự do cho bạn cảm giác như ở chính nhà của mình.\",\"+ Trước cửa nhà là trạm xe bus tiện đi tất cả các Quận trong thành phố.\",\"+ Máy giặt miễn phí.\",\"+ Cửa sổ và ban công đem thiên nhiên vào phòng bạn.\",\"+ Thang máy cho bạn di chuyển nhẹ nhàng.\",\"+ Có đội sữa chữa, hổ trợ mọi vấn đề 24/24.\",\"+ Vị trí ngay trung tâm siêu thuận lợi: Nhà nằm đối diện nhà thi đấu, trường đua Phú Thọ, ngay cạnh các ngã tư Lý Thường Kiệt – Tô Hiến Thành – Đường 3/2 – Thành Thái – Nguyễn Tri Phương. Gần sát bên các Đại Học Bách Khoa, ĐH Y Dược, ĐH Hoa Sen, ĐH Huflit …. Gần Bệnh Viện Chợ Rẫy, BV 115, BV ĐH Y Dược … thuận tiện đi lại mọi nơi trong thành phố.\",\"+ Khu dân cư an ninh, yên tĩnh, rất thích hợp cho các bạn sinh viên, nhân viên văn phòng, gia đình hay người nước ngoài sinh sống và làm việc.\",\"+ Giá thuê bất ngờ: Chỉ với: 6 Triệu - 6.5 Triệu/Tháng cho Căn Hộ rộng với Phòng Ngủ và Phòng Khách riêng  bạn sẽ sở hữu ngay một căn phòng như mình mong muốn.\",\"- Sự hài lòng của quí khách là niềm vui của chúng tôi.\",\"- Vui lòng gọi ngay A. Hoàng qua số: 0937554570 (nhiệt tình và chu đáo) để hẹn gặp bạn tại chính căn phòng sang trọng, tuyệt vời này!\"]', 'ee42e1eb-b814-4ed0-849f-2be2400f80cd', '275391e2-07cc-4856-b456-a95207a3d531', '40868445-6558-4989-a520-47e20cfd1f57', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('fc83d4b7-6890-425b-9d43-3cf746c3a616', 'Căn Hộ Cao Cấp 30m2 Cửa Sổ Đón Nắng Full Nội Thất Ngay Ngã 4 Phú Nhuận,Chợ Bà Chiểu,5P Đi BV Hoàn Mỹ', '0', 'OXBP5', 'Địa chỉ: Đường Phùng Văn Cung, Phường 7, Quận Phú Nhuận, Hồ Chí Minh', 'da1ba874-9c2c-4732-8dd1-786004bc83df', 'CTCH', '[\"Vị trí: 94D Phùng Văn Cung, Phường 7, Quận Phú Nhuận.\",\"-----------------\",\"Ngay ngã tư Phú Nhuận, gần trường CĐ Kinh Tế Đối Ngoại, gần khu ăn uống Phan Xích Long, Vạn Kiếp.\",\"Giao nhau tại Phan Xích Long và Phan Đăng Lưu\",\"Qua Chợ Nguyễn Đình Chiểu, nhà Thờ Tân Định 5p đi xe.\",\"Cách Chợ Bà Chiểu 500m, gần cây xăng, các điểm dịch vụ tiện ích, phòng GYM. Tiện qua các quận Bình Thạnh, Tân Bình, Gò Vấp, Quận 1 và Quận 3.\",\"------------------\",\"Full nội thất 1 phong ngủ CÓ ban công lớn\",\"Giờ giấc tự do không chung chủ.\",\"Hệ thống điện nước ổn định, wifi tốc độ cao.\",\"Dịch vụ dọn vệ sinh hàng tuần (3 lần/tuần).\",\"Hệ thống camera giám sát an ninh, bảo vệ 24/24.\",\"----------------------\",\"Liên hệ : BÙI LỆ ( call,zalo) để đến xem nhà trực tiếp và ở ngay\",\"️ Cảm ơn khách hàng đã xem bài viết, chúc quý khách có 1 ngày vui vẻ. ️\"]', 'b92ff507-5cfb-4930-985b-bb5c30e6040f', '155c7c32-ee60-4bba-8c1f-32418a94d392', 'cdce5551-0343-40b3-ad7e-a1b7611afd6e', '2023-08-27 08:27:07', '2023-08-27 08:27:07'),
('fe3c7eb7-2419-499f-97de-94b60b3c1897', 'CHO THUÊ VĂN PHÒNG/ PHÒNG DẠY HỌC MẶT TIỀN ĐƯỜNG LẠC LONG QUÂN, ĐẦY ĐỦ TIỆN NGHI', '0', 'BAGL8', 'Địa chỉ: Đường Lạc Long Quân, Phường 5, Quận 11, Hồ Chí Minh', 'c66865ca-4c30-4e2f-8252-2a38c06dc744', 'CTMB', '[\"Diện tích: 40m².\",\"- Đầy đủ tiện nghi hỗ trợ cho việc dạy học\",\"- Được trang bị TiVi, Máy lạnh, bàn ghế giáo viên - học sinh, bảng trắng,...\",\"- Phòng học mới, khang trang, cho thuê theo tháng/ theo giờ\",\"- Có 2 option cho bạn lựa chọn: phòng có nội thất giảng dạy cơ bản và phòng cho bạn tự decor\",\"- Tận dụng tối ưu hóa diện tích.\",\"- Vị trí nằm ngay mặt tiền đường Lạc Long Quân.\",\"- Free wifi, máy lạnh, nhà vệ sinh sạch sẽ\",\"- Khu vực yên tĩnh, An ninh tốt, có chỗ để xe trong và ngoài tòa nhà\",\"- Có thể mở lớp dạy được ngay\",\"Gía cả: 110.000/giờ hoặc thuê theo tháng\",\"Liên hệ: Hoài Vi - 036 886 4804\"]', 'f4ffd0de-e5fa-4ebd-bc75-062a5cabc65c', '103040fc-9bbe-4b9e-a24d-51f15a604d62', 'e8509928-b9e9-4e7d-aeaa-454384263b22', '2023-08-28 14:15:02', '2023-08-28 14:15:02'),
('ff3497a0-9fea-4523-9dd4-488b8bfc6289', 'Nhà Mặt Tiền Hẻm 4, thông qua trường Đại Học Y Dược, Nhà Full Nội Thất', '0', 'RITB8', 'Địa chỉ: Nguyễn Văn Linh, Phường An Khánh, Quận Ninh Kiều, Cần Thơ', '1231d4ac-0f0f-456b-aee6-1625554e4057', 'NCT', '[\"• CHO THUÊ - NHÀ MINI HOUSE MẶT TIỀN HẺM 4 NGUYỄN VĂN LINH\",\"GIÁ: 6,5 Triệu/Tháng (Cọc 1 tháng)\",\"- Diện tích: 4,5 x 9\",\"- DTSD: 60m2\",\"- Lộ giới: 6m 2 oto qua mặt\",\"- Hướng: Đông nam\",\"- Kết cấu: Trệt lửng, sân trước rộng rải..trang bị sẳn Tủ Lạnh, Máy lạnh, Máy giặt, Sofa, Tủ áo, Nệm, Máy nóng lạnh, Tủ bếp, Màn cửa.v.v...\",\"• Vị trí: Trục chính hẻm 4 Nguyễn Văn Linh thông qua khu Đại Học Y Dược...vị trí đẹp thuận tiện ở hoặc mở spa, Nail, shop....\",\"LIÊN HỆ: 0917 112 811 gặp TOÀN (NC)\"]', '7a13333c-7767-4c84-ad1e-16917d64fb89', '448119f6-5f0b-4ebf-ade7-27d8fda9cc35', 'ec634064-872e-467e-8a8b-a5b661fb17a8', '2023-08-28 14:17:02', '2023-08-28 14:17:02');
